    <style>
        :root {
            /* Dark Theme (Default) */
            --primary-bg: #1a1a1a;
            --secondary-bg: #2c2c2c;
            --card-bg: #333;
            --primary-text: #ffffff;
            --secondary-text: #b0b0b0;
            --accent-color: #007bff;
            --accent-hover: #0056b3;
            --border-color: #444;
            --loader-color: #ffffff;
            --shadow-color: rgba(0, 0, 0, 0.2);
            --success-color: #4CAF50;
            --warning-color: #FB8C00;
            --card-radius: 12px;
            --font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Helvetica, Arial, sans-serif;
        }

        [data-theme="light"] {
            --primary-bg: #f5f5f5;
            --secondary-bg: #ffffff;
            --card-bg: #ffffff;
            --primary-text: #212121;
            --secondary-text: #757575;
            --accent-color: #1867C0;
            --accent-hover: #1F5592;
            --border-color: #e0e0e0;
            --loader-color: #1867C0;
            --shadow-color: rgba(0, 0, 0, 0.1);
            --card-radius: 12px;
            --font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Helvetica, Arial, sans-serif;
        }
        
        /* ✨ NEW SQUID GAME THEME ✨ */
        [data-theme="squid"] {
            --primary-bg: #000000;
            --secondary-bg: #111111;
            --card-bg: #1d1d1d;
            --primary-text: #ffffff;
            --secondary-text: #cccccc;
            --accent-color: #E83F6F; /* Squid Game Pink */
            --accent-hover: #ff7096;
            --border-color: #E83F6F;
            --loader-color: #E83F6F;
            --shadow-color: rgba(232, 63, 111, 0.2);
            --success-color: #00A896; /* Squid Game Teal */
            --warning-color: #F9A602;
            --card-radius: 0px;
            --font-family: 'Roboto Mono', monospace;
        }

        /* --- GENERAL STYLES --- */
        * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
        }

        body {
            font-family: var(--font-family);
            background-color: var(--primary-bg);
            color: var(--primary-text);
            transition: background-color 0.3s, color 0.3s;
        }
        
        /* --- PAGE & LAYOUT --- */
        .page {
            display: none;
            padding: 1.5rem;
            max-width: 1200px;
            margin: 0 auto;
        }

        .page.active { display: block; }

        .page-header {
            display: flex;
            align-items: center;
            margin-bottom: 2rem;
            padding: 0.75rem;
            background-color: var(--secondary-bg);
            border-radius: var(--card-radius);
            box-shadow: 0 4px 15px var(--shadow-color);
            border: 1px solid var(--border-color);
        }

        .back-button, .theme-toggle {
            background: none;
            border: none;
            color: var(--primary-text);
            cursor: pointer;
            padding: 0.6rem;
            border-radius: 50%;
            transition: background-color 0.2s, transform 0.2s;
        }
        .back-button:hover, .theme-toggle:hover {
            background-color: var(--border-color);
            transform: scale(1.1);
        }

        .page-title {
            font-size: 1.75rem;
            margin-left: 1rem;
            flex-grow: 1;
        }
        
        .theme-toggle-container {
            position: fixed; top: 1rem; right: 1.5rem; z-index: 1000;
        }
        
        /* --- GRID CONTAINER --- */
        .grid-container {
            display: grid;
            gap: 1.5rem;
            grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
        }
        
        /* --- CARD STYLES (Grid) --- */
        .card {
            background-color: var(--card-bg);
            border-radius: var(--card-radius);
            overflow: hidden;
            box-shadow: 0 4px 12px var(--shadow-color);
            transition: transform 0.2s, box-shadow 0.2s;
            display: flex;
            flex-direction: column;
            cursor: pointer;
            border: 1px solid var(--border-color);
        }
        .card:hover {
            transform: translateY(-5px);
            box-shadow: 0 8px 20px var(--shadow-color);
        }
        .card-thumbnail {
            width: 100%; height: 180px; object-fit: cover;
            background-color: var(--secondary-bg);
        }
        .card-content {
            padding: 1rem; flex-grow: 1;
            display: flex; flex-direction: column;
        }
        .card-header {
            display: flex; align-items: center;
            gap: 0.75rem; margin-bottom: 0.75rem;
        }
        .card-icon {
            width: 40px; height: 40px; border-radius: 50%;
        }
        .card-title {
            font-size: 1.1rem; font-weight: 600; color: var(--primary-text);
        }
        .card-details {
            font-size: 0.9rem; color: var(--secondary-text);
            margin-bottom: 1rem; flex-grow: 1;
        }
        .card-details p {
            margin-bottom: 0.25rem; display: flex; align-items: center;
        }
        .card-details svg { margin-right: 0.5rem; flex-shrink: 0; }
        .card-footer { margin-top: auto; }
        
        .study-button {
            width: 100%;
            padding: 0.75rem;
            background-color: var(--accent-color);
            color: var(--primary-bg);
            border: none;
            border-radius: var(--card-radius);
            cursor: pointer;
            font-weight: 600;
            transition: background-color 0.2s;
            font-family: var(--font-family);
        }
        .study-button:hover { background-color: var(--accent-hover); }

        .topic-card {
            padding: 1rem; display: flex; align-items: center;
            justify-content: space-between;
        }
        .topic-card-content { color: var(--primary-text); }
        .topic-card-content p { color: var(--secondary-text); font-size: 0.9rem; }
        
        /* --- TABS --- */
        .tabs {
            display: flex;
            border-bottom: 2px solid var(--border-color);
            margin-bottom: 1.5rem;
        }
        .tab {
            padding: 0.75rem 1.5rem; cursor: pointer; border: none;
            background: none; color: var(--secondary-text);
            font-weight: 600; position: relative; transition: color 0.2s;
        }
        .tab:hover { color: var(--primary-text); }
        .tab.active {
            color: var(--accent-color);
            border-bottom: 3px solid var(--accent-color);
        }

        /* --- MISC --- */
        .loader-container {
            position: fixed; top: 0; left: 0; width: 100%; height: 100%;
            background-color: rgba(0, 0, 0, 0.7);
            display: flex; justify-content: center; align-items: center; z-index: 9999;
        }
        .spinner {
            border: 4px solid var(--secondary-bg); border-top: 4px solid var(--loader-color);
            border-radius: 50%; width: 50px; height: 50px;
            animation: spin 1s linear infinite;
        }
        @keyframes spin { 0% { transform: rotate(0deg); } 100% { transform: rotate(360deg); } }
        
        .attention-message {
            text-align: center; padding: 1rem;
            background-color: rgba(251, 140, 0, 0.1); color: var(--warning-color);
            border: 1px solid var(--warning-color); border-radius: var(--card-radius);
            margin: 1.5rem auto; max-width: 800px;
        }
        .attention-message .highlight { font-weight: 700; color: var(--success-color); }
        
        .player-container {
            width: 100%; max-width: 900px; margin: 0 auto;
            aspect-ratio: 16 / 9; background-color: #000;
            border-radius: var(--card-radius); overflow: hidden;
            border: 1px solid var(--border-color);
        }
        #player { width: 100%; height: 100%; }
        .player-title { font-size: 1.4rem; margin-top: 1.5rem; text-align: center; }
    </style>
</head>
